import React, { Component } from 'react'
//这里是 角色列表----------------------添加用户的按钮
import {Form,Input} from 'antd'
const Item = Form.Item
export default class AddForm extends Component {
    render() {
        return (
            <Form>
                <Item label="角色名称" name="username">
                    <Input placeholder="请输入角色名称"/>
                </Item>
            </Form>
        )
    }
}
